import React from 'react'

function Labels() {
  return (
    <div>
      {LabelComponent()}
    </div>
  )
}

export default Labels


function LabelComponent(){
    return (
        <>
            <div className='labels flex justify-between'>
                <div className='flex gap-2'>
                    <h3>Savings</h3>
                </div>
                <h3>45%</h3>
            </div>
        </>
    )
}
